import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
    max-width: 800px;
    position: relative;
    padding: 1.2rem;
    background: #ffffff;
    background-clip: padding-box;
    box-shadow: 0 12px 15px 0 rgba(0, 0, 0, 0.25);
`;

export const ModalWindow = () => {
  return <Wrapper>
    asdf
  </Wrapper>
}
